import './LoginForm.css';

function LoginForm (){

    const click = () => {
        alert("Vous avez cliqué");
    }

    return(
        <>
            <div className='container'>
                <h2>Container</h2>
                <button onClick={click}>Bouton</button>

                <div className='formNouveau'>
                    <h2>Form</h2>
                </div>
            </div>

            
        </>
    )

}

export default LoginForm;
